import React from "react";
import { SearchForm, Input, TimePicker, Form, Button } from "antd";

import CurdComponent from "@/components/CurdComponent";
// import SelectOption from "@/components/SelectOption";

const getSearchFormFields = () => {
    return [
        {
            label: "证券帐户",
            id: "accountId",
            // initialValue: "",
            component: <Input placeholder="请输入证券帐户" />,
        },
        {
            label: "证券代码",
            id: "securityId",
            // initialValue: "",
            component: <Input placeholder="请输入证券代码" />,
        },
        {
            label: "开始时间",
            id: "startTime",
            component: <TimePicker placeholder="请输入开始时间" />,
        },
        {
            label: "结束时间",
            id: "endTime",
            component: <TimePicker placeholder="请输入结束时间" />,
        },
    ];
};
let columns = () => {
    return [
        {
            title: "用户ID",
            dataIndex: "uuserId",
            key: "uuserId",
            width: 80,
        },
        {
            title: "证券帐户",
            dataIndex: "accountId",
            key: "accountId",
            width: 120,
        },
        {
            title: "证券代码",
            dataIndex: "securityId",
            key: "securityId",
            width: 100,
        },
        {
            title: "证券代码源",
            dataIndex: "securityIdSource",
            key: "securityIdSource",
            width: 120,
        },
        {
            title: "持仓类型",
            dataIndex: "positionType",
            key: "positionType",
            width: 100,
        },
        {
            title: "持仓数量",
            dataIndex: "positionQty",
            key: "positionQty",
            width: 100,
        },
        {
            title: "当前开盘前的原始仓位数量",
            dataIndex: "originQty",
            width: 200,
        },
        {
            title: "当天前的原始持仓的平均开仓价格00",
            dataIndex: "originOpenPrice",
            width: 250,
        },
        {
            title: "可卖数量",
            dataIndex: "freeQty",
            key: "freeQty",
            width: 100,
        },
        {
            title: "冻结数量",
            dataIndex: "frozenQty",
            key: "frozenQty",
            width: 100,
        },
        {
            title: "平均价格00",
            dataIndex: "price",
            width: 100,
        },
        {
            title: "盈亏",
            dataIndex: "profitAndLoss",
            key: "profitAndLoss",
            width: 100,
        },
        {
            title: "收益率",
            dataIndex: "profitRate",
            key: "profitRate",
            width: 100,
        },
        {
            title: "版本号",
            dataIndex: "version",
            width: 120,
        },
        {
            title: "更新时间",
            dataIndex: "updateTime",
            key: "updateTime",
            width: 150,
        },
    ];
};
export default class Cccx extends React.PureComponent {
    state = {
        searchLoading: false,
        info: [],
        pagination: { total: 0 },
    };
    handleSearch = (params, pagination) => {
        // console.log("获取搜索栏数据 ", params);
        this.getData(params, pagination);
    };
    getData = (params, pagination = { current: 1, pageSize: 20 }) => {
        // console.log(pagination);
        http.get({
            url: "/user-position/list",
            data: params,
        }).then((res) => {
            console.log(res);
            //解析数据字典
            if (res.data.length > 0) {
                parseDict(res.data);
                showStip(this);
            } else {
                message.info("查询结果为空");
            }
            this.setState({
                info: res.data,
            });
        });
    };

    componentDidMount() {
        this.getData();
    }
    render() {
        let scroll = { x: 1200, y: 445 };
        let info = this.state.info;
        return (
            <div>
                <SearchForm
                    // fields={this.getSearchFormFields()}
                    fields={this.getSearchFormFields()}
                ></SearchForm>
            </div>
        );
    }
}
